import React, { Component } from "react";
import Layout from "../../components/Layout";

class Gogaxy extends Component {

    render() {
        return (
            <Layout>
                <div className="container">
                    <div className="d-flex justify-content-center">
                        <h1>Go Gaxy</h1>
                        <div className="shadow-lg p-3 mb-5 bg-dark rounded">
                            <iframe frameborder="0" src="https://itch.io/embed-upload/1859418?color=333333" allowfullscreen="" width="940" height="530">
                                <a href="https://aowsay.itch.io/go-gaxy">Play Go Gaxy on itch.io</a>
                            </iframe>
                        </div>
                    </div>
                    <br />
                </div>
            </Layout>
        )
    }
}

export default Gogaxy;
